import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
function Navbar() {
  return (
    <div className="navbar">
      {/* <ul>
         <Link to="/"><li>Home</li></Link>
        <li>About Us</li>
        <li>Pricing</li>
       <Link to="/signup"> <li> Sign Up</li></Link>
        <li>LogIn</li>
        <li> <Link to="/settings"><i class="fa-solid fa-gear"></i></Link></li>

    </ul>
  */}
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          {" "}
          <Link>About Us</Link>
        </li>
        <li>
          {" "}
          <Link>Pricing</Link>
        </li>
        <li>
          {" "}
          <Link to="/signup"> Sign Up</Link>
        </li>
        <li>
          {" "}
          <Link>LogIn</Link>
        </li>
        <li>
          {" "}
          <Link to="/settings">
            <i class="fa-solid fa-gear"></i>
          </Link>
        </li>
      </ul>
    </div>
  );
}

export default Navbar;
